import React from 'react';

const FirewallGuidePage = () => {
  return (
    <div>
      <h1>방화벽 설정을 확인해주세요.</h1>
      <button onClick={() => window.location.href = '/'}>
        방화벽 설정 완료. 
        다시 테스트 시도하기.
      </button>
    </div>
  );
};

export default FirewallGuidePage;
